import React from "react";

const items = [
  {
    Name: "Pc",
  },
  {
    Name: "XBOX",
  },
  {
    Name: "Others",
  },
];

const SideBar = () => {
  return (
    <div class="side_bar">
      <div class="side_bar_items">
        <form>
          <label>
            <input type="searsh" name="name" placeholder="Searsh" />
          </label>
        </form>
        {items.map((e) => (
          <div> e.Name</div>
        ))}
      </div>
    </div>
  );
};
export default SideBar;
